.
.
And during all these times, the only person that didn't give up on me, is myself, my inner self actually showed me how strong and capable I was to overcome all the darkness, all the negativities. It constantly helped me to show how important it was to remain calm and composed, how important it was to not lose the cool and not think something bad or negative for someone.
